/* qpsol:(h[54x54,21nz],g[54],a[86x54,226nz],lba[86],uba[86],lbx[54],ubx[54],x0[54],lam_x0[54],lam_a0[86],q[],p[])->(x[54],cost,lam_a[86],lam_x[54]) */
static int casadi_f26(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  char buf[121];
  int flag;
  struct casadi_qp_data d;
  struct casadi_qp_prob p;
  p.sp_a = casadi_s22;
  p.sp_h = casadi_s27;
  p.sp_at = casadi_s23;
  p.sp_kkt = casadi_s28;
  p.sp_v = casadi_s29;
  p.sp_r = casadi_s30;
  p.prinv = casadi_s31;
  p.pc =  casadi_s32;
  casadi_qp_setup(&p);
  p.max_iter = 1000;
  p.min_lam = 0;
  p.constr_viol_tol = 1e-08;
  p.dual_inf_tol = 1e-08;
  d.prob = &p;
  d.nz_h = arg[0];
  d.g = arg[1];
  d.nz_a = arg[2];
  casadi_qp_init(&d, &iw, &w);
  /* Pass bounds on z */
  if (arg[5]) {
    casadi_copy(arg[5], 54, d.lbz);
  } else {
    casadi_fill(d.lbz, 54, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 86, d.lbz+54);
  } else {
    casadi_fill(d.lbz+54, 86, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 54, d.ubz);
  } else {
    casadi_fill(d.ubz, 54, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 86, d.ubz+54);
  } else {
    casadi_fill(d.ubz+54, 86, casadi_inf);
  }
  /* Pass initial guess */
  if (arg[7]) {
    casadi_copy(arg[7], 54, d.z);
  } else {
    casadi_clear(d.z, 54);
  }
  casadi_fill(d.z+54, 86, casadi_nan);
  if (arg[8]) {
    casadi_copy(arg[8], 54, d.lam);
  } else {
    casadi_clear(d.lam, 54);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 86, d.lam+54);
  } else {
    casadi_clear(d.lam+54, 86);
  }
  /* Solve QP */
  if (casadi_qp_reset(&d)) return 1;
  while (1) {
    flag = casadi_qp_prepare(&d);
    if (d.iter % 10 == 0) {
      if (casadi_qp_print_header(&d, buf, sizeof(buf))) break;
      CASADI_PRINTF("%s\n", buf);
    }
    if (casadi_qp_print_iteration(&d, buf, sizeof(buf))) break;
    CASADI_PRINTF("%s\n", buf);
    if (flag || casadi_qp_iterate(&d)) break;
  }
  /* Get solution */
  if (res[1]) casadi_copy(&d.f, 1, res[1]);
  if (res[0]) casadi_copy(d.z, 54, res[0]);
  if (res[3]) casadi_copy(d.lam, 54, res[3]);
  if (res[2]) casadi_copy(d.lam+54, 86, res[2]);
  return d.status != QP_SUCCESS;
  return 0;
}

/* solver:(x0[54],p[5],lbx[54],ubx[54],lbg[86],ubg[86],lam_x0[54],lam_g0[86])->(x[54],f,g[86],lam_x[54],lam_g[86],lam_p[5]) */
